var Node = function(prefix){
    this.value = prefix;
    this.children = [];
    this.isWord = false;
}

Node.prototype = {
    addChild: function(letter, value){
        var n = new Node(value);
        this.children[letter] = n;
    },
    contains: function(suffix){
        if(!suffix) return false;
        return this.children[suffix[0]] !== undefined;
    },
    first: function(){
        if(this.isWord === true) return this.value; 
        var keys = this.getKeys();
        var l = keys[0];
        if(keys.length > 1 && keys[1].toLowerCase() == keys[0].toLowerCase()){
            var rs = [];
            l = keys[0].toLowerCase();
            var L = l.toUpperCase();
            rs.push(this.children[l].first());
            rs.push(this.children[L].first());
            rs.sort(caseInsensitiveSort);
            return rs[0];
        }else if(keys.length) return this.children[l].first();
        else return '';
    },
    find: function(suffix){
        if(!suffix) return this.first();
        var l = suffix[0].toLowerCase();
        var L = l.toUpperCase();
        var rest = suffix.substring(1);
        var finds = [];
        if(this.contains(l)) finds.push( this.children[l].find(rest) );
        if(this.contains(L)) finds.push( this.children[L].find(rest) );
        finds.sort(caseInsensitiveSort);
        return finds[0];
    },
    getKeys: function(){
        var keys = [];
        for(var p in this.children){
            if( this.children.hasOwnProperty(p) ){
                keys.push(p);
            }
        }
        keys.sort(caseInsensitiveSort);
        return keys;
    }
}

var PrefixTree = function(){
    this.root = new Node('');
}

PrefixTree.prototype = {
    addWord: function(word){
        var n = this.root;
        for( var i=0; i<word.length; i++ ){
            if( !n.contains(word[i]) ){
                n.addChild(word[i], word.substring(0,i) + word[i]);
            }
            n = n.children[word[i]];
        }
        n.isWord = true;
    },
    find: function(prefix){
        var n = this.root;
        var finds = n.find(prefix);
        if(!finds)  return -1;
        return finds;
    }
}

var caseInsensitiveSort = function (a,b){
    if (a.toLowerCase() < b.toLowerCase()) return -1;
    if (a.toLowerCase() > b.toLowerCase()) return 1;
    return 0;
}

function typeahead(usernames, queries) {
    var prefixTree = new PrefixTree();
    // console.time('hello');
    for( var i=0; i<usernames.length; i++){
        prefixTree.addWord(usernames[i]);
    }
    var results = [];
    for(var i=0; i<queries.length; i++){
        results.push(prefixTree.find( queries[i] ));
    }
    console.log(results.join('\n'));
    // console.timeEnd('hello');
}


